import React, {Fragment} from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; 
import Navbar from './components/layouts/Navbar';

const App = () => {
  return (
    <Router>
      <Fragment>
          <Navbar/>
          <Switch>
            <Route to='/' com></Route>
          </Switch>
      </Fragment>
    </Router>
  )
}

export default App
